insert into MY_TABLE (id, debug, "userId", "testAccountId", version, name, type, url, request, apijson, sqlauto, standard, header, date, detail) values (1607881932306, 0, 99999, 0, 3, '@raw 自定义 SQL 片段', 'JSON', '/get', '{   // 类似 12306 根据始发站和到达站来过滤火车班次，班次和线路多对一，线路和站点多对多
    "sql@": {
        "from": "Comment",
        "join": "&/Comment:to/userId@",
        "Comment": {  // 假装是始发站
            "@column": "userId",
            "content~": "a",  // 假装是站点名
            "momentId>": "to.momentId",
            "@raw": "momentId>"
        },
        "Comment:to": {  // 假装是终点站
            "userId@": "/Comment/userId",
            "@column": "",
            "content~": "j"  // 假装是站点名
        }
    },
    "[]": {
        "Moment": {  // 假装是班次
            "userId{}@": {
                "from": "User",
                "User": {  // 假装是线路
                    "id{}@": "sql",
                    "@column": "id"
                }
            }
        }
    },
    "@explain": true
}
                                                                                                                                                                                                              
', null, null, null, '', '2020-12-14 01:52:12.000000', null);
